import { Octokit } from "@octokit/core";
import React from 'react';

const octokit = new Octokit();

octokit.request('GET /repos/{owner}/{repo}/releases', {
  owner: 'microsoft',
  repo: 'vscode'
}).then(
  (response) => {
    console.log(response);
  }
);

function App() {
  return (
    <div className=".app-container">
      hi
    </div>
  );
}

export default App;
